import { Container, Row, Col } from 'react-bootstrap';



function ScoreAndLives() {
  let lives = 3;
  let score = 0;


  return (
    <div className="ScoreAndLives">
      <div className="Row">
        <div>
          Vidas: {lives}
        </div>
        <div>
          Puntos: {score}
        </div>
      </div>
    </div>
  );
}

export default ScoreAndLives;
